import React from 'react';

const MovieList = (props) =>{
  return(
    <>
      {props.movies.map((movies,index) =>(
        <div className="image-container">
          <img src={movies.Poster} alt="movie"></img>
        </div>
      ))}
    </>
  );
};

export default MovieList;
